.CodeMirror-wrap, #editor{
font-size:17px;
}

.CodeMirror-content, .CodeMirror-gutter { min-height: 150px; }
.CodeMirror-gutters{margin:1px;}
.CodeMirror-scroller{overflow:auto; }
.CodeMirror-wrap{border:1px solid silver}


#terminal .toggle {
cursor: pointer;
}

#terminal pre {
background: black;
color: #ccc;
padding: 5px 10px 10px 10px;
border-radius: 5px 5px 0 0;
margin: 5px 0 0 0;
height: 200px;
overflow-y: auto;
}

#terminal input.command {
width: 100%;
background: #333;
color: #fff;
border: 0;
border-radius: 0 0 5px 5px;
margin-bottom: 5px;
padding: 5px;
}




#terminal span.toggle i::before {
content: "\f107";
}

#terminal span.toggle.collapsed i::before {
content: "\f105";
}

#terminal span.command {
color: #eee;
}

.fa-file {
color: #000;
}

.fa-folder {
color: #f5c205;
}




body.dark-mode,
body.dark-mode .modal-header,
body.dark-mode .modal-footer {
background: #2b373d;
color: #fff;
}

body.dark-mode #files,
body.dark-mode .btn-secondary,
body.dark-mode nav.bg-light,
body.dark-mode #menu,
body.dark-mode .dropdown-menu,
body.dark-mode .modal-body {
background: #445760!important;
}

body.dark-mode a,
body.dark-mode #path,
body.dark-mode .btn-light,
body.dark-mode #editor,
body.dark-mode .modal-header .close {
color: #fff;
}



body.dark-mode .fa.fa-folder,
body.dark-mode .fa.fa-file {
font-weight: 900;
}

body.dark-mode .fa-file {
color: #fff;
}

body.dark-mode .jstree-default .jstree-leaf>.jstree-ocl,
body.dark-mode .jstree-default .jstree-open>.jstree-ocl {
filter: invert(1);
}

body.dark-mode .fa.fa-file {
color: #eee;
}

body.dark-mode .jstree-clicked,
body.dark-mode .jstree-clicked i {
color: #444 !important;
}


body.dark-mode .menu-button,
body.dark-mode .file-button,
body.dark-mode .dark-mode-button,
body.dark-mode .help-button,
body.dark-mode .editor-type-button,
body.dark-mode .terminal-button,
body.dark-mode #editor {
background: #445760 !important;
border: 0;
}

body.dark-mode .text-muted {
color: #eee !important;
}

body.dark-mode .modal-content {
background-color: transparent;
}

body.dark-mode .modal-header,
body.dark-mode .modal-footer {
border: 0;
}



.heading-alert a.change-password {
color: inherit;
font-weight: bold;
text-decoration: underline;
}


#menu{
display:none;
overflow:auto!important;
}
@media (max-width:992px){
#menuFundo{
width:100%!important;
height:100%!important;
position:fixed!important;
top:0!important;
left:0!important;
background-color: rgba(0, 0, 0, 0.7)!important;
