left:0!important;
overflow-x:hidden!important;
padding:0!important;
border-radius:0!important;
background-color:#eeeeee!important;
z-index:999!important;
}
}


#loading{
position:fixed;
top:0;
left:0;
right:0;
bottom:0;
z-index:9;
width:100%;
height:100%;
font-size:100px;
color:white;
